import React from "react";
import PomodoroTimer from "../components/PomodoroTimer";
import TaskForm from "../components/TaskForm";
import TaskList from "../components/TaskList";
import "../App.css";

const Home = () => {
  return (
    <div className="App-container">
      <PomodoroTimer />
      <TaskForm />
      <TaskList />
    </div>
  );
};

export default Home;
